import React from 'react'
import Greenbtn from './Greenbtn';
import { HiHome, HiOutlineBars3BottomLeft } from "react-icons/hi";
import {  FaHome, FaTimes } from "react-icons/fa";
import { SiTwitch, SiLinkedin, SiFacebook, SiAboutdotme } from "react-icons/si";


const Navbar = () => {

  const links = [
    {
      id: 1,
      link: 'home',
    },
    {
      id: 2,
      link: 'services',
    },
    {
      id: 3,
      link: 'about',
    },
    {
      id: 4,
      link: 'support',
    },
    {
      id: 5,
      link: 'pricing'
    }
  ]



  return (
    <div className='w-screen h-20 z-20 fixed bg-gray-900 text-white'>
    <div className='px-3 flex items-center justify-between w-full h-full '>
      <div className='flex items-center'>
        <h1 className='text-4xl font-bold'>Onnn</h1>
      </div>

      <ul className='hidden md:flex'>
       {links.map(({id,link})=>(
        <li key={id} className='capitalize p-4 cursor-pointer hover:text-lightcolor duration-200'>
          {link}
         </li>
       ))}
      </ul>

      <div className='hidden md:flex mr-4'>
        <Greenbtn title='Sign in' className='px-9 py-3'/>
      </div>
      <div className=''>
        <div className='cursor-pointer'>
          <HiOutlineBars3BottomLeft/>
        </div>
      </div>
    </div>
    </div>
  )
}

export default Navbar
